import React, { Component } from 'react';
import { NavLink } from 'react-router-dom'
import './index.css';


class MainBody extends Component {


  render(){

    return (
      <div className='main-box'>
        <div className='main-slab' id='questions'><NavLink to='/ask-me-anything' className='main-slab'>Anonymous Advice</NavLink></div>
        <NavLink to='/scheduling' className='main-slab'><div id='schedule'>Schedule a Session</div></NavLink>
      </div>
    );
  }
}

export default MainBody;
